<template>
    <div class="blogCss">
        <div class="blog">
            <div class="blogTitle">vue-router 怎么获取页面的历史记录？</div>
            <div class="blogContent" v-highlight>
                <p><Icon type="md-checkmark" style="color:green"/> 有效</p>
                <p><Icon type="md-close" style="color:red"/> ------------------------------------------ </p>
                <p> 即，怎么获取用户访问过的页面的全部历史记录</p>
                <p>先让我们来看看this.$router里面有啥内容</p>
                <script type="text/html">
                    this.$route.matched // 网上有人说这是历史堆 放屁
                </script>
                <p><img style="max-width:100%" src="data:image/png;base64," alt=""></p>
                <p>同理 检查this.$route 对象</p>
                <p><img style="max-width:100%" src="data:image/png;base64," alt=""></p>
                <p><font color="red">这个说明vue路由不负责或者不管历史记录对象内容(或者管不着)</font></p>
                <p>参考 https://developer.mozilla.org/zh-CN/docs/Web/API/Window/history</p>
                <script type="text/html">
                    var history = window.history
                    history.back() // 等同于点击浏览器的回退按钮
                    history.go(-1) // 等同于history.back()
                    // 未授权代码无法清除会话历史（session History），也不能禁用回退/前进功能。
                    // 最快捷的可用方式是使用location.replace()方法，提供指定的URL来替换当前的会话历史（session history）。
                </script>
                <p>擦就这么点内容</p>
                <p>back()：回退到上一个访问记录; 在历史记录中后退：window.history.back();</p>
                <p>forward()：前进到下一个访问记录; 在历史记录中前进：window.history.forward();</p>
                <p>go(num)：跳转到相应的访问记录;其中num大于0，则前进;小于0，则后退; </p>
                <p>例如：后退一页window.history.go(-1); 向前移动一页window.history.go(1);</p>
                <p>查看历史记录栈中一共有多少个记录点：window.history.length;</p>
                <p>pushState(stateData, title, url)：在history中创建一个新的访问记录，不能跨域，且不造成页面刷新;</p>
                <p>replaceState(stateData, title, url)：修改当前的访问记录，不能跨域，且不造成页面刷新;</p>
                <p>另，HTML5新增了可以监听history和hash访问变化的全局方法：</p>
                <p>window.onpopstate：当调用history.go()、history.back()、history.forward()时触发;pushState()\replaceState()方法不触发。</p>
                <p>window.onhashchange：当前 URL 的锚部分(以 '#' 号为开始) 发生改变时触发。触发的情况如下：</p>
                <p>a、通过设置Location 对象 的 location.hash 或 location.href 属性修改锚部分;</p>
                <p>b、使用不同history操作方法到带hash的页面;</p>
                <p>c、点击链接跳转到锚点。</p>
                <p><img style="max-width:100%" src="data:image/jpeg;base64," alt=""></p>
                <p><img style="max-width:100%" src="data:image/png;base64," alt=""></p>
                <p><Button @click="jump1()">我是页面0我要跳页面1</Button></p>
                <p><Button @click="jump1jump2()">我是页面0我要跳页面1再跳页面2</Button></p>
                <p><Button @click="jumpjump2()">我是页面0我要跳页面1再跳页面2 要求页面1不初始化</Button></p>
                <p>应用场景</p>
                <p>点击首页 进入页面tab 有 1234</p>
                <p>页面1 有个发布按钮</p>
                <p>点击发布 进入发布表单界面 看看即正常回退 break</p>
                <p>点击发布 进入发布表单界面 编辑保存 要求跳转到页面2</p>
                <p><font color="red">如果正常回退 则是 页面2-发布页面-页面1</font></p>
                <p>但是我们要求 回退 页面2-页面首页 怎么搞?????????????</p>
                <p>解</p>
                <p>1 准备一个状态来管理跳转但不渲染的路由</p>
                <p>2 路由卫士负责根据状态来决定是否渲染下一个页面</p>
                <script type="text/js">
                    // 想要的效果是回退再前进 之间的页面不做渲染
                    // 注意不要使用next(false) 这样会触发异常机制 会复原url
                    // 使用return 算是中止 但不影响url
                    if (Store.state.system.doNotDrawRouter) { return }
                </script>
                <p>3 改状态 跳转/回退 改状态 延时500ms跳转新路由页面</p>
                <script type="text/js">
                    // 建议封装一个方法
                    this.$store.dispatch('route/noRender', true).then(() => {
                        this.$router.go(-2)
                        setTimeout(() => {
                            this.$store.dispatch('route/noRender', false).then(() => {
                                this.$router.push({'name': 'expV2_exp05_057history@3'})
                            })
                        },500)
                    })
                </script>
            </div>
            <div class="blogFooter">
                <Tag color="green">收集</Tag>
                <Tag color="cyan">学习</Tag>
                <Tag color="blue">增长</Tag>
            </div>
        </div>
    </div>
</template>
<script>
export default {
    data () {
        return {}
    },
    methods: {
        jump1 () {
            this.$router.push({'name': 'expV2_exp05_057history@1'})
        },
        jump1jump2 () {
            this.$router.push({'name': 'expV2_exp05_057history@1'}, () => {
                this.$router.push({'name': 'expV2_exp05_057history@2'})
            })
        },
        jumpjump2 () {
            this.$store.dispatch('route/noRender', true).then(() => {
                this.$router.push({'name': 'expV2_exp05_057history@1'})
                setTimeout(() => {
                    this.$store.dispatch('route/noRender', false).then(() => {
                        this.$router.push({'name': 'expV2_exp05_057history@2'})
                    })
                }, 500)
            })
        }
    },
    mounted () {
        console.log('我是页面0')
        console.log(this.$router)
        console.log(this.$route)
    }
}
</script>
